const mongoose = require('mongoose');

const PersonSchema = new mongoose.Schema({
    firstName:String,
    lastName:String,
    gender:String,
    age:String,
    email:String,
    education:String,
    salary:String,
    maritialStatus:String
})

mongoose.model("person", PersonSchema);
